import React from "react";
import styled from "styled-components";
import Link from "next/link";

const FirstWrapper = styled.div`
  width: 100%;
`;

const App = () => {
  const columns = [
    {
      title: "번호",
      dataIndex: "id",
    },
    {
      title: "제목",
      render: (data) => (
        <Link href="/detail">
          <DataTitle>{data.title}</DataTitle>
        </Link>
      ),
    },
    { title: "작성자", dataIndex: "author" },
    {
      title: "작성일",
      dataIndex: "createdAt",
    },
    {
      title: "조회수",
      dataIndex: "hit",
    },
  ];
  return (
    <>
      <FirstWrapper>asd</FirstWrapper>
    </>
  );
};

export default App;
